import React, { useEffect, useState } from "react";

const Pagination = ({ showPerPage }) => {
     const [counter, setCounter] = useState(1);

     useEffect(() => {
          consolelog("object");
     }, [counter]);
     return (
          <>
               <button
                    className='bg-color'
                    onClick={() => setCounter(counter - 1)}>
                    previous
               </button>
               <button
                    className='bg-color'
                    onClick={() => setCounter(counter + 1)}>
                    next
               </button>
          </>
     );
};

export default Pagination;
